// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;


import "@openzeppelin/contracts/token/ERC1155/ERC1155.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

contract Marketplace is ReentrancyGuard {
    ERC1155 public erc1155Token;

    struct Listing {
        address seller;
        uint256 tokenId;
        uint256 price;
        uint256 quantity;
        bool active;
    }

    Listing[] public listings;
    uint256 public listingId = 1;

    event ItemListed(uint256 indexed listingId, address indexed seller, uint256 indexed tokenId, uint256 price, uint256 quantity);
    event ItemPurchased(uint256 indexed listingId, address indexed buyer, uint256 indexed tokenId, uint256 quantity, uint256 totalPrice);

    constructor(address _erc1155Token) {
        erc1155Token = ERC1155(_erc1155Token);
    }

    function listItem(uint256 _tokenId, uint256 _price, uint256 _quantity) external {
        require(erc1155Token.balanceOf(msg.sender, _tokenId) >= _quantity, "Insufficient balance");
        require(erc1155Token.isApprovedForAll(msg.sender, address(this)), "Contract not approved for token transfer");

        listings.push(Listing({
            seller: msg.sender,
            tokenId: _tokenId,
            price: _price,
            quantity: _quantity,
            active: true
        }));

        emit ItemListed(listingId, msg.sender, _tokenId, _price, _quantity);
        listingId++;
    }

    function purchaseItem(uint256 _listingId, uint256 _quantity) external payable {
        require(_listingId > 0 && _listingId <= listings.length, "Invalid listing ID");
        Listing storage listing = listings[_listingId - 1];
        require(listing.active, "Listing not active");
        require(listing.quantity >= _quantity, "Not enough quantity available");
        require(msg.value >= listing.price * _quantity, "Insufficient funds");

        listing.quantity -= _quantity;
        if (listing.quantity == 0) {
            listing.active = false;
        }

        erc1155Token.safeTransferFrom(listing.seller, msg.sender, listing.tokenId, _quantity, "");
        payable(listing.seller).transfer(msg.value);

        emit ItemPurchased(_listingId, msg.sender, listing.tokenId, _quantity, listing.price * _quantity);
    }
}

